import { transactions } from "../../mock/trsMock";
import { LOAD_DATA } from "./constants";

export const loadTransactions = () => (dispatch) => {
  dispatch({
    type: LOAD_DATA,
    payload: transactions,
  });
};

const filterFields = {
    transactionId:'5d9',
}


export const filterData = (filterFields) => (dispatch) => {

    dispatch({
      type: LOAD_DATA,
      payload: transactions,
    });
  };
